import keyMirror from 'keymirror';

export default keyMirror({
  AIRPORT_HAS_ERRORED: null,
  AIRPORT_FETCH_DATA_SUCCESS: null,
  TICKETS_IS_LOADING: null,
  TICKETS_HAS_ERRORED: null,
  TICKETS_FETCH_DATA_SUCCESS: null,
});
